import React from "react";
import "./Masthead.css";

export class Masthead extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      username: this.props.username,
    };
  }
  state = {
    username: "Sample_Username",
  };

  render() {
    var logoImage = "./MastheadImages/CluelessLogo.png";
    var gameIcon = "./MastheadImages/GameIcon.png";
    var helpIcon = "./MastheadImages/HelpIcon.png";
    var aboutIcon = "./MastheadImages/AboutIcon.png";
    var settingsIcon = "./MastheadImages/SettingsIcon.png";
    return (
      <div class="masthead">
        <span class="logo">
          <img src={logoImage} />
        </span>

        <div class="dropdown">
          <button class="dropbtn">Dropdown</button>
          <div class="dropdown-content">
            <span>
              <img src={logoImage} />
              <a href="#"> Game Info </a>
            </span>
            <span>
              <img src={logoImage} />
              <a href="#"> Help </a>
            </span>
            <span>
              <img src={logoImage} />
              <a href="#"> About </a>
            </span>
            <span>
              <img src={logoImage} />
              <a href="#"> Settings </a>
            </span>
          </div>
        </div>
      </div>
    );
  }
}

export default Masthead;
